import "./Styles/Contact.css";



function Contact() {
    return(
        <div className="contact">
            <div className="message"> Down below are where you can contact me directly by phone number, and email and also by github !  </div>

            <br/>

            <div>
              Phone Number: 9292595678
              <br/> 
               Email: aly.kourouma@lc.cuny.edu

            </div>

            <a href="https://github.com/akourouma1" className="navLinkinfo">
              Github Link
            </a>

        </div>

    );
}
export default Contact;
